import React from 'react';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import Image from 'react-bootstrap/Image';
import dashi from '../dashi.png';
import google from '../google.png';
import paak from '../paak.png';
import Nav from 'react-bootstrap/Nav';
import Figure from 'react-bootstrap/Figure';
class Footer extends React.Component {
    constructor(props) {
        super();
        this.state = {
        };
    }
    render() {
        //Might be better to use Figures than Images
        return (
            <div>
                <Container>
                    <Row className="justify-content-md-center">

                        <Col md={{ span: 2, offset: 1 }}>

                        </Col>

                        <Col md={{ span: 3, offset: 2 }}>
                            <p>Featured On</p>
                        </Col>


                        <Col md={{ span: 2, offset: 1 }}>

                        </Col>
                    </Row>
                    <Row className="justify-content-md-center">

                        <Col  xs={5}>
                            <Figure>
                                <Figure.Image
                                    width={111}
                                    height={30}
                                    alt="111x30"
                                    src={dashi}
                                />
                            </Figure>
                        </Col>

                        <Col  xs={5}>
                        <Figure>
                                <Figure.Image
                                    width={111}
                                    height={30}
                                    alt="111x30"
                                    src={google}
                                />
                            </Figure>
                        </Col>


                        <Col>
                        <Figure>
                                <Figure.Image
                                    width={55}
                                    height={30}
                                    alt="55x30"
                                    src={paak}
                                />
                            </Figure>
                        </Col>

                    </Row>
                    <Row className="justify-content-md-center">
                        <Nav>
                            <Nav.Item>
                                <Nav.Link href="https://www.instagram.com/stkmedia.io/">Active</Nav.Link>
                            </Nav.Item>
                            <Nav.Item>
                                <Nav.Link hreff="https://www.youtube.com/channel/UCHWPaaEa869JkNMkrsrFZ1w/featured">Link</Nav.Link>
                            </Nav.Item>
                        </Nav>
                    </Row>
                    <Row className="justify-content-md-center">
                        <p>Copyright © 2020 STK MEDIA</p>
                    </Row>
                </Container>
            </div>

        );
    }
}

export default Footer;
